import { GET_DATA } from "../types"

const initialState = {
  foodmenu: []
}

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_DATA:
      return {
        ...state,
        foodmenu: action.payload
      }
    default:
      return state
  }
}
